import Checkout from './Checkout';
import Login from './Login';

function App() {
  return (
    //BEM
    <Router>
      <div className="app">
        <Routes>
        <Route path="/" element={<login />} />
        <Route path="/" element={<checkout />} />
        <Route path="/" element={<home />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
